import React from "react";

const Card = () => {
  return (
    <figure className="card">
      <img
        src="https://wovenmagazine.com/content/uploads/2019/09/03_CodyCobb_Wide.jpg"
        alt="image"
      />
      <figcaption>
        <span className="tag">In Print</span>
        <span className="author">Hawoly Ba | Photographer</span>
        <h3>Eons of Earth</h3>
        <p>
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Ipsam enim
          eligendi amet! Et reiciendis, hic, in assumenda incidunt neque amet
          fugit iste voluptas omnis dolore quia aperiam, adipisci perferendis
          sunt.
        </p>
        <time>2019.01.01</time>
      </figcaption>
    </figure>
  );
};

export default Card;
